window.bookSummaryJSON = "<p>Facing fate just might be a death sentence.</p> <p>Cait:</p> <p>With a deadline set by the Supernatural Council, I have less than a month to figure out how to remain out of their grasp. Being their magical slave isn’t part of my plan.</p> <p>As the clock keeps ticking, I focus on Roman and the growing bond between us. No matter what happens, I know that as long as we stay together, everything else will find a way to work itself out...that is if nobody tries to claim what’s mine.</p> <p>Roman:</p> <p>Keeping Cait safe should have been easy, but when unknown foes continue to interfere, it will take every bit of my strength to keep from destroying everything in my path.</p> <p>Cait is my world now and there isn’t anything that can keep me from her. Not even death.</p> <p>This is the final book in Heather Renee’s Luna Marked series, part of her Mystics and Mayhem world. Next, check out the complete Broken Court books - also part of Mystics and Mayhem - while you wait for Scorned by Blood, the third trilogy in this world!</p>"; 
